import { ExpandMore } from "@mui/icons-material";
import {
  Accordion,
  AccordionDetails,
  AccordionSummary,
  Chip,
  Stack,
  Typography,
} from "@mui/material";
import React from "react";
export default function Groups({ group }) {
  return (
    <Accordion>
      <AccordionSummary expandIcon={<ExpandMore />} id={group.id}>
        <Typography>{group.name}</Typography>
      </AccordionSummary>
      <AccordionDetails>
        <Stack direction="row" spacing={1} justifyContent="center">
          {group.count.map((val, i) => (
            <Chip
              key={i}
              label={val}
              sx={{ fontSize: "2rem", py: 2 }}
              color={group.next === val ? "warning" : "default"}
            />
          ))}
        </Stack>
      </AccordionDetails>
    </Accordion>
  );
}
